from collections import deque

def first_non_repeating_char(stream):
    queue = deque()
    count = {}
    for char in stream:
        if char not in count:
            count[char] = 1
            queue.append(char)
        else:
            count[char] += 1
        while queue and count[queue[0]] > 1:
            queue.popleft()
        if queue:
            print(queue[0])
        else:
            print(-1)
